import "./App.css";
import React from "react";
import Nav from "./components/Nav";
import Header from "./components/Header";
import Main from "./components/Main";
import Footer from "./components/Footer";

class App extends React.Component {
  constructor() {
    super();
    this.headers = [
      {
        id: "tab-home",
        name: "Home",
        slogan: "I build websites as I am telling a story",
        href: "#tab-home",
      },
      {
        id: "tab-weeks",
        name: "Week",
        slogan: "I do into detail each with my time the Awesome Inc Bootcamp",
        href: "#tab-weeks",
      },
      {
        id: "tab-photos",
        name: "Photos",
        slogan: "I do into detail each with my time the Awesome Inc Bootcamp",
        href: "#tab-photos",
      },
      {
        id: "tab-articles",
        name: "Articles",
        slogan: "I do into detail each with my time the Awesome Inc Bootcamp",
        href: "#tab-articles",
      },
      {
        id: "tab-projects",
        name: "Projects",
        slogan: "I do into detail each with my time the Awesome Inc Bootcamp",
        href: "#tab-projects",
      },
      {
        id: "tab-aboutMe",
        name: "About Me",
        slogan: "I do into detail each with my time the Awesome Inc Bootcamp",
        href: "#tab-aboutMe",
      },
    ];
  }

  render() {
    /*
    ===========================================================
                    Helper Functions
    ===========================================================
    */
    const mapHelperNav = (nav, index) => {
      return <Nav href={nav.href[index]} name={nav.href[index]} />;
    };
    const mapHelperHeader = (header, index) => {
      return (
        <Header
          id={header.id[index]}
          name={header.name[index]}
          slogan={header.slogan[index]}
        />
      );
    };
    /*
    ===========================================================
                    Display
    ===========================================================
    */
    return (
      <div>
        <div className="App container">
          {this.headers.map(mapHelperHeader)}
          {this.headers.map(mapHelperNav)}
        </div>
      </div>
    );
  }
}
export default App;
